import '../App.css';
import React from 'react';
import { Container } from 'semantic-ui-react';
import FixtureList from './fixtureList';

const Home = (props) => {

    return(
       <Container className="App">
            <Container className='border'>
               <FixtureList fixtures={props.fixtures} round={props.round} updateRound={props.updateRound}/>
            </Container>
       </Container>
    )  

}

export default Home;
